import {
    Index,
    Classify,
    Fengwei
} from "../page"



export const mainRoutes =[
    {
        path:"/index",
        component:Index
    },
    {
        path:"/classify",
        component:Classify
    },
    {
        path:"/fengwei",
        component:Fengwei
    }
]

export const indexRoutes=[
    {
        path:"/index/one",
        component:One
    },
    {
        path:"/index/eat",
        component:Eat
    },
    {
        path:"/index/beautiful",
        component:Beautiful
    },
    {
        path:"/children",
        component:Children
    },
    {
        path:"/index",
        component:Index
    },
    {
        path:"/out",
        component:Out
    },
    {
        path:"/direction",
        component:Direction
    }

]
